const EncryptedCode = "";

import { Sable } from "./sablejs.mjs"

const VM = new Sable();
const J = VM.getGlobal();

let newlinks;
const vFunc = VM.createFunction('log', function () {
    newlinks = VM.asString(arguments[0]);
});
VM.setProperty(J, 'log', vFunc);

function decrypt(infoid, link5) {
    VM.setProperty(J, "infoid", VM.createString(infoid));
    VM.setProperty(J, "link5", VM.createString(link5));
    VM.run(EncryptedCode);
    return newlinks;
}

export { decrypt }
